import React from 'react'
import { withRouter } from 'react-router'
import InputField from '../InputField'
import { DownOutlined } from '@ant-design/icons'
import { Dropdown, Space } from 'antd'

const items = [
    {
        label: <a href='https://www.antgroup.com'>1st menu item</a>,
        key: '0',
    },
    {
        label: <a href='https://www.aliyun.com'>2nd menu item</a>,
        key: '1',
    },
    {
        type: 'divider',
    },
    {
        label: '3rd menu item',
        key: '3',
    },
]

const Navbar = ({ history }) => {
    const route = history?.location?.pathname || window.location.pathname
    const noNavPage = ['/signup', '/login']

    if (noNavPage.includes(route)) return null

    // TODO: kabhi kabhi navbar nahi aati

    const title = 'foodie'

    return (
        <>
            <div className='navbar-container'>
                <div className='navbar-left'>
                    <span className='navbar-title' style={{ color: 'white', fontFamily: 'cursive', fontSize: 35 }}>
                        {title}
                    </span>
                    <InputField
                        placeholder='Search for Food, Cuisine and Restaurants'
                        onSearch={(e) => console.log(e)}
                        style={{
                            width: 200,
                        }}
                        type='search'
                    />
                </div>
                <Dropdown
                    menu={{
                        items,
                    }}
                    trigger={['click']}
                >
                    <a onClick={(e) => e.preventDefault()}>
                        <Space>
                            More
                            <DownOutlined />
                        </Space>
                    </a>
                </Dropdown>{' '}
                {/* if logged in -> show logout and home, profile,setting
              if not logged in show login signup */}
            </div>
        </>
    )
}

export default withRouter(Navbar)
